import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super()
    this.state = {
     monster1: {
      name:'AKSHAY'
     },
     monster2:{
      name:'Neha'
     },
     monster3:{
      name:'Akshara'
     },
    };
  }
  render() {
    return (
      <div className="App">
        <p>Hello</p>
      </div>
    );
  }
}

export default App;
